// 快剑斩乱麻：武林中有一招，名曰'斩麻'，用于整理散乱无比之剑谱。此招威力在于化繁为简，以一招之力，清乱如风。
// 此乃江湖传说之快剑门绝学之起手势。
function quickSort(arr) {
  // 观望敌阵：若只是一人或根本无踪迹可循之地，则静待其变，不宜出手。
  if (arr.length <= 1) return arr;

  // 选定主位者：自古英雄必居中，于队伍中择一名武艺卓越之弟子作为首领，以其为标杆。
  const pivot = arr[0];
  // 左右互搏之阵型：左面列阵为较弱轻骑军（left），右方布下强力猛士（right），以迎敌。
  const left = [];
  const right = [];

  // 渡劫试炼：各队伍依次上阵，若武功逊色于首领者入轻骑队列，其余尽入猛士阵容待命。
  for (let i = 1; i < arr.length; i++) {
    // 比高下，判归属：弱者左归，强者右行。
    if (arr[i] < pivot) {
      left.push(arr[i]);
    } else {
      right.push(arr[i]);
    }
  }
  // 分兵布阵已罢，各自为阵。令轻骑与猛士各依其队再行演练（即各自施展出同样的一套斩麻招数），最后将轻骑、首领以及所有强人合并一路，形成无敌阵容。
  // 吾辈练至此时已可出剑江湖，笑傲群敌也。
  return [...quickSort(left), pivot, ...quickSort(right)];
}
